import { Card } from "antd";
import React from "react";

const PostCard = ({ post }) => {
  return (
    <div>
      <Card cover={post.Images[0]}>
        <Image />
        <Content />
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
